import React, { Suspense, lazy } from 'react';
import ReactDOM from 'react-dom/client';
import './css/index.css';
import loadingImage from './components/public/load_screen_univ.avif'; // Убедитесь, что путь к изображению правильный

const UniverseSwitcher = lazy(() => import('./components/UniverseSwitcher'));

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Suspense fallback={<img src={loadingImage} alt="Загрузка..." />}>
      <UniverseSwitcher />
    </Suspense>
  </React.StrictMode>
);
